import React from 'react';
import {
  Anchor,
  Box,
  Card, 
  CardBody, 
  CardFooter,
  Header,
  Grommet,
  Select,
  Nav} from 'grommet';
import logo from './logo.svg';
import './App.css';

function App() {
  const options = ['location', 'size']
  return (
    <Grommet full>
      <>
      <Header background="light-4" pad="small">
      <Nav direction="row">
        <Anchor label="Home" href="#" />
        <Anchor label="Profile" href="#" />
      </Nav>
    </Header>    
    <Box>
    <Select
    id="text-input"
    options={options}
    placeholder="Search"
/>
</Box>
      </>
    </Grommet>
  );
}

export default App;
